import React, { Component } from 'react';
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import SignInScreen from './components/SignInScreen';
import Fokusz from './components/Fokusz';
import UserRedirectHandler from './components/UserRedirectHandler';

const App = ()=> {
  return (
    <Router>
       <div>
         <Route exact path ="/" component={SignInScreen} />
         <Route path ="/Fokusz" component={Fokusz} />
         <Route path ="/UserRedirectHandler" component={UserRedirectHandler} />
       </div>
    </Router>
  );
};

export default App;
